('2093','18','7726','Villa Popescu',Null,'Extravagante moderne Villa in erster Meereslinie von Santa Ponsa','27316','In ruhiger Lage entstand 2009 auf einem 1.800 m² großen westlich ausgerichteten Hanggrundstück diese moderne und Licht durchflutete Villa, die durch einen spektakulären Meerblick besticht. Über den Eingang im Erdgeschoss betritt man die Eingangshalle, die übergangslos in das Wohn-Esszimmer übergeht. Große Panoramafenster geben den Blick frei über den Pool auf das Meer und die Felsenküste. Des Weiteren befinden sich auf dieser Wohnebene noch eine hochmoderne Einbauküche, ein Schlafzimmer mit Bad und ein Gäste-WC. Die obere Etage beherbergt 4 Schlafzimmer und 3 Badezimmer.\r\nZur hochwertigen Ausstattung gehören: weißer Mikrozement-Boden mit Fußbodenheizung (Wärmepumpe), eine Klimaanlage w/k und doppelt verglaste Sicherheitsfenster. Im Außenbereich kann man sich in einem von Terrassen umgebenen Pool erfrischen.','27317','5000000','111','2013-08-21 14:30:21','110','2013-08-21 14:30:49',Null,'1964','121','937',1,'1','0',Null,Null,Null,'27318',Null,'0','0','0',Null,'2016-03-08 14:33:42',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'27319',Null,'27320',Null,'27321',Null,'27322',Null,'27323','0',0,'0');
